Group Rules

@media 브라우저가 이 조건 만족 시 적용
@supports 브라우저가 이 기능 지원 시 적용
@document 페이지가 이 조건 만족 시 적용

참고로 이 규칙들은 쉼표를 사용하여 동시에 적용시킬 수 없음.
대신, 괄호 내 조건끼리 and or(,로 대체가능) not 으로 연결가능
사용 예시
@media (min-width : 800px) {
    background-color : "blue";
}

Transition
transform에 대한 시간, 속도 등을 설정

이 속성은 움직일 요소의 선택자에 직접 설정함.
transition-property 어느 속성에 적용할지 설정
property duration timing-function delay 묶어서 transition으로 사용함
시간 속성은 처음에 나오는게 무조건 duration 이 됨. 

Transform
transition을 통해 설정한 시간, 속도대로 실제 어떤 움직임을 사용할지 설정

이 속성은 움직일 행동 선택자에 설정해줌.
큰 따옴표를 사용하지 않는 함수를 값으로 가짐.

실습
transform-origin
기준점을 설정해줌.
0% 0%와 같은 백분위, left top과 같은 키워드만 사용가능.
Animation
대상 선택자에 속성을 설정하고, @keyframe을 통해 구체적인 행동을 설정

이 속성은 대상 요소의 선택자에 설정해줌.
animation-name은 반드시 첫번째 값으로 입력
처음으로 입력한 시간은 duration이 됨.

animation-direction

normal 행동 1회 종료 후 다시 제자리로 돌아온 뒤 재시작
reverse 종료 지점에서 시작하고, 진행 방향도 반대, 종료 후 종료 지점에서 재시작
alternate 홀수번째 시작은 normal 짝수번째 시작은 reverse
alternate-reverse 홀수번째 시작은 reverse 짝수번째 시작은 normal

실습
@keyframes
animation속성으로 시간 및 횟수를 설정했다면 진행 지점별 행동을 설정할 수 있음.
@keyframes animation-name {
    0% {
        0퍼센트에 할일
    }
    50% {
        50퍼센트에 할일
    }
    100% {
        100퍼센트에 할일
    }
}

만약 진행 지점이 0%와 100%밖에 없다면 from과 to를 사용할 수 있음.
@keyframes animation-name {
    from {
        0퍼센트에 할 일
    }
    to {
        100퍼센트에 할 일
    }
}

list/javascript/3.html.body:
Scope
var는 함수단위, let은 블록단위 스코프를 가짐
아래 코드는 2가 출력됨.
var a = 1;
if(true) {
    var a = 2;
}
console.log(a);

아래 코드는 1이 출력됨.
let b = 1;
if(true) {
    let b = 2;
}
console.log(b);

Argument, Parameter
함수의 길이는 매개변수의 수를, arguments의 길이는 인자의 수를 나타낸다.
let test = function (parm1, parm2, parm3) {
  console.log(`매개변수 개수 : ${test.length}`);
  console.log(`인자 개수 : ${arguments.length}`);
}

Context
다음과 같은 코드가 있다.
var name = 'zero'; // (1)변수 선언 (6)변수 대입
function wow(word) { // (2)변수 선언 (3)변수 대입
  console.log(word + ' ' + name); // (11)
}
function say () { // (4)변수 선언 (5)변수 대입
  var name = 'nero'; // (8)
  console.log(name); // (9)
  wow('hello'); // (10)
}
say(); // (7)

호이스팅으로 인해 함수 선언식으로 생성된 wow say 함수는 동째로 최상단으로 올려짐
컨텍스트의 모습은
전역컨텍스트: {
    변수객체:{
        arguments: null, 
        variable: [name,wow,say]
    }, 
    scopechain: [전역 변수객체], // 스코프체인은 자기자신과 상위 스코프의 변수객체임.
    this: window
}

'say컨텍스트' : {
    변수객체: {
        arguments: null,
        variable: ['name'],
    },
    scopeChain: ['say변수객체', '전역 변수객체'],
    this: window
}

'wow컨텍스트': {
    변수객체 : {
        arguments: [{word:'hello'}],
        variable: null,
    },
    scopechain: ['wow변수객체', '전역변수객체'],
    this: window
}
Closure
컨텍스트의 원리를 활용하면 클로져를 사용할 수 있음.
var makeClosure = function() {
    var name = 'zero';
    return function () {   
      console.log(name);
    }
  };
  var closure = makeClosure();

  closure();

위 코드의 컨텍스트는
"전역 컨텍스트": {
  변수객체: {
    arguments: null,
    variable: [{ makeClosure: Function }, 'closure'],
  },
  scopeChain: ['전역 변수객체'],
  this: window,
}

"makeClosure 컨텍스트": {
  변수객체: {
    arguments: null,
    variable: [{ name: 'zero' }],
  },
  scopeChain: ['makeClosure 변수객체', '전역 변수객체'],
  this: window,
}

"closure 컨텍스트":  {
  변수객체: {
    arguments: null,
    variable: null,
  scopeChain: ['closure 변수객체', 'makeClosure 변수객체', '전역 변수객체'],
  this: window,
}
makeClosure변수의 값은 익명함수가 된다. (반환값이 변수의 값이 되기 때문) 그래서 외부에서는 무슨 방법을 써도 name변수에 접근할 수 없음.
만약 makeClosure변수가 외부함수 없이 바로 익명함수를 저장한다면 makeClosure.name으로 접근이 가능함.

